import {FETCH_PRODUCTS} from "../action-types";
import appData from '../../api/appData';


export const fetchProducts = (type, item) =>  dispatch => {
    const products = appData.products[type][item];

    dispatch({
        type: FETCH_PRODUCTS,
        payload: products
    })
};
